import React, { Component } from 'react'

 class Prices extends Component {
    
   state={
       currency:'USD'
   }
    render() {
        
        return (
            <div>
               <ul className="list-group">
                   <li className="list-group-item">
                       Bitoin rates for {this.props.bpi}
                   </li>
               </ul>
            </div>
        )
    }
}

export default Prices
